import * as actionTypes from './actionTypes'

const defaultState = {
    topBanners: []
}

function reducer(state = defaultState, action){
    console.log(state);
    switch (action.type) {
        case actionTypes.CHANGE_TOP_BANNER:
            console.log(action.topBanners)
            break;
        default:
            return state

    }
    return state;
}

export {
    reducer
}
